import React from 'react';
import './cta.css';

const ctaData = [
  {
    title: 'Average Rent',
    description: '₹2-2.5 lakhs per month',
  },
  {
    title: 'Title 2',
    description: 'Description for Title 2',
  },
  {
    title: 'Title 3',
    description: 'Description for Title 3',
  },
  {
    title: 'Title 4',
    description: 'Description for Title 4',
  },
];

const CTATile = ({ title, description }) => {
  return (
    <div className="cta__tile">
      <h3>{title}</h3>
      <p>{description}</p>
    </div>
  );
};

const CTA = () => {
  return (
    <div className="gpt3__cta section__margin">
      <div className="gpt3__cta-content">
        <h1>Data</h1>
      </div>
      <div className="cta__container">
        {ctaData.map((cta, index) => (
          <div className="cta__parent-tile" key={index}>
            <CTATile 
              title={cta.title} 
              description={cta.description} 
            />
          </div>
        ))}
      </div>
    </div>
  );
};

export default CTA;
